import React from "react";
import styled from "styled-components";

const Main = styled.div`
    background: green;
    height: 100%;
    width: 20%;
    padding: 0 20px;
`;

const Title = styled.div`
    height: 20%;
    width: 100%;
    P{
        font-size: 30px;
    }
`;

const List = styled.div`
    height: 70%;
    width: 100%;
    background: aqua;
`;

const Item = styled.div`
    background: red;
    boerder-bottom: 5px solid grey;
    height: 25%;
    width: 100%;
`;

export default function index() {
    return (
        <Main>
            <Title><p>LINKS</p></Title>
            <List>
                <Item>

                </Item>
            </List>
        </Main>
    )
}
